import React, { Component } from 'react';
import '../App.css';

class Cabecera extends Component {
  render() {
    return (
        <header className="App-header">
          <div className="row">
            <div className="col-md-2"></div>
            <div className="col-md-8"></div>
          </div>
          
        </header>
    );
  }
}

export default Cabecera;
